import React, { Component } from 'react';

export interface IUrl {
    url: {
        res: string,
        url: string,
    }[]
}

const UrlBody = (urls: IUrl) => {
    const rows = urls.url.map((row, index) => {
        return (
            <div className="dropdown-menu" key={index}>
                <td><a href={row.url} rel="nofollow" target="_blank">{row.res}</a></td>
            </div >
        )
    })
    return (
        <div className="mt-3 d-flex justify-content-center dropdown show">
            <tbody>{rows}</tbody>
        </div>

    )
};

export default UrlBody;
